import React from "react";
import Navigation from "../../Navigation/Navigation";

const Yearly = () => {

    const MONTHS = [
        {
            id: '1',
            month: 'January',
            year: '2021',
            budget: '500',
            balance: '200',
        },
        {
            id: '2',
            month: 'February',
            year: '2021',
            budget: '700',
            balance: '300',
        },
        {
            id: '3',
            month: 'March',
            year: '2021',
            budget: '800',
            balance: '150',
        }];

    return (
        <div>
            <Navigation></Navigation>
            <h1>Yearly balance</h1>
        </div>
    )
}

export default Yearly;
